      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 + - col2 + - + col2 + col2 * col2 + - col2 * - col0 * - 13 NOT BETWEEN NULL AND - 67 + - + 7;
  - name: tab1

outputs:
  - name: q3298.out
    data: |
